import classes from './Main.module.css';

const Main = (props) => {
  return (
    <div className={classes.main}>
      <img
        className={classes.logo}
        src="https://storage.googleapis.com/pr-newsroom-wp/1/2018/11/Spotify_Logo_RGB_White.png"
        alt="logo"
      ></img>
      <nav className={classes.navigation}>
        <ul>
          <li>Home</li>
          <li>Search</li>
          <li>Your Library</li>
        </ul>
      </nav>
    </div>
  );
};

export default Main;
